<?
set_time_limit(0);

$vs = '';
$ev = '';

for ($i = 1; $i <= 18885; $i++)
{
	print "Getting page $i/18885 [".number_format($i / 18885 * 100, 2)."%]\n"; flush();
	
	$fields = array(
		'__EVENTTARGET' => 'ctl00$ContentPlaceHolderBody$DropDownList2',
		'__EVENTARGUMENT' => '',
		'__LASTFOCUS' => '',
		'__VIEWSTATE' => $vs,
		'__EVENTVALIDATION' => $ev,
		'ctl00$ContentPlaceHolderBody$DropDownList2' => $i
	);
	
	$post = '';
	foreach ($fields as $key => $value)
	{
		$post .= urlencode($key).'='.urlencode($value).'&';
	}
	$post = rtrim($post, '&');
	
	$ch = curl_init();
	curl_setopt($ch, CURLOPT_URL, 'http://bacalaureat.edu.ro/Pages/TaraRezultAlfa.aspx');
	curl_setopt($ch, CURLOPT_USERAGENT, 'curl');
	curl_setopt($ch, CURLOPT_POST, count($fields));
	curl_setopt($ch, CURLOPT_POSTFIELDS, $post);
	curl_setopt($ch, CURLOPT_RETURNTRANSFER, true);
	$result = curl_exec($ch);
	curl_close($ch);
	
	$vs = ext($result, '/__VIEWSTATE" value="([^"]+)/');
	$ev = ext($result, '/__EVENTVALIDATION" value="([^"]+)/');
	
	file_put_contents("data13/page_$i.html", $result);
	$result = null;
}

print "Done!\n"; flush();

function ext($data, $regex)
{
	preg_match($regex, $data, $match);
	return $match[1];
}
?>